% -*- mode: prolog -*-

calc012(0, L, 0, 0, 0, L).
calc012(N, [X|L], A1, B1, C1, L1) :-
    N > 0, N1 is N - 1,
    calc012(N1, L, A, B, C, L1),
    ( X = 0, A1 is A + 1, B1 = B, C1 = C
    ; X = 1, A1 = A, B1 is B + 1, C1 = C
    ; X = 2, A1 = A, B1 = B, C1 is C + 1
    ).

min_layer(N, [], layer(N,0,0)).
min_layer(N, L, X) :-
    calc012(N, L, A, B, C, L1),
    min_layer(N, L1, layer(A1,B1,C1)),
    ( A < A1, X = layer(A,B,C)
    ; X = layer(A1,B1,C1)
    ).

adv08(X) :- image(I), min_layer(150, I, layer(_,X1,X2)), X is X1 * X2, !.

take_layer(0, L, [], L) :- !.
take_layer(N, [X|L], [X|L1], R) :-
    N > 0, N1 is N - 1,
    take_layer(N1, L, L1, R).

% First parameter is front, second back.
merge([], [], []).
merge([2|L1], [X|L2], [X|L3]) :- merge(L1, L2, L3).
merge([X|L1], [_|L2], [X|L3]) :- X \= 2, merge(L1, L2, L3).

merge_layers(N, I, X) :- take_layer(N, I, X, []).
merge_layers(N, I, X) :-
    take_layer(N, I, L1, I1),
    merge_layers(N, I1, L2),
    merge(L1, L2, X).

adv08b :- image(I), merge_layers(150, I, L), write_layer(L), !.

% Display

write_row(0, L, L) :- nl.
write_row(N, [X|L], L1) :-
    N > 0, N1 is N - 1,
    ( X = 1, write('O')
    ; X = 0, write('.')
    ), write_row(N1, L, L1).

write_rows(0, _).
write_rows(N, L) :-
    N > 0, N1 is N - 1,
    write_row(25, L, L1), write_rows(N1, L1).

write_layer(L) :- write_rows(6, L).

